CREATE TABLE `app_template` (
    `id` bigint(20) COMMENT 'ID',
    `out_app_id` varchar(255) COMMENT '外部应用ID',
    `out_id` varchar(255) COMMENT '云应用外部ID',
    `out_name` varchar(255) COMMENT '云应用外部名称',
    `name` varchar(255) COMMENT '名称',
    `version_num` varchar(255) COMMENT '版本号',
    `type` varchar(255) COMMENT '类型',
    `compute_type` varchar(64) COMMENT '计算类型',
    `queue_names` text COMMENT '队列名称列表',
    `state` varchar(64) COMMENT '状态',
    `image` varchar(64) COMMENT '镜像',
    `bin_path` text COMMENT '可执行文件路径',
    `scheduler_param` text comment '调度器参数',
    `license_manager_id` varchar(64) COMMENT '许可证管理ID',
    `enable_residual` tinyint(4) COMMENT '启用残差图',
    `residual_log_parser` varchar(64) COMMENT '残差图日志解析器',
    `enable_snapshot` tinyint(4) COMMENT '启用云图',
    `script` mediumtext COMMENT '脚本',
    `content` mediumtext COMMENT '内容',
    `icon` mediumtext COMMENT '图标',
    `description` text COMMENT '描述',
    `doc_type` varchar(64) COMMENT '文档类型',
    `doc_content` text COMMENT '文档内容',
    `create_time` datetime COMMENT '创建时间',
    `update_time` datetime COMMENT '更新时间',
    PRIMARY KEY (`id`)
) ENGINE = InnoDB DEFAULT CHARSET = utf8 COMMENT = '应用模板表';

INSERT INTO app_template (id, out_app_id, name, version_num, type, compute_type, state, image, bin_path, license_manager_id, script, content, icon, description, doc_type, doc_content, create_time, update_time, out_id, out_name, queue_names)
